					<column>
						<div class="title">
							Do you assess designs?
						</div>
						<div class="line"></div>
						<div class="content">
							We assess all designs on their commercial potential with our audience, and if we feel a
							design does not meet the required standards it will only be available for customers to buy
							directly from the creatorâ€™s profile (it will not appear in search results or occasion
							categories). We do this because unfortunately not all of the designs we have uploaded are of
							interest to our buying customers, and the more content we put in front of customers which is
							not of interest to them, the more likely they are to be put off and not buy at all!
						</div>
					</column>
				</columns>
			</div>
