							What kinds of designs should I upload?
						</div>
						<div class="line"></div>
						<div class="content">
							We are on the lookout for unique content which is different to the ranges we already have.
							Think originally! Cards need to be designed for specific, card-sending occasions, and we
							find that incorporating current trends can really help too. If your cards donâ€™t have a
							significant point of difference to content we already have, they wonâ€™t be made available
							across the whole of the thortful site!
						</div>
